<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Who Will Sign?</title>
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        body {
            font-family: 'FK Grotesk', -apple-system, BlinkMacSystemFont, 'Segoe UI', sans-serif;
            background: #FAF9F6;
            min-height: 100vh;
            display: flex;
            flex-direction: column;
            justify-content: center;
            align-items: center;
            padding: 20px;
        }

        .container {
            text-align: center;
            padding: 40px;
        }

        h1 {
            color: #11191F;
            margin-bottom: 30px;
            font-size: 2.5em;
            font-weight: 500;
        }

        .coin-container {
            perspective: 1000px;
            margin: 40px auto;
            width: 300px;
            height: 300px;
        }

        .coin {
            width: 100%;
            height: 100%;
            position: relative;
            transform-style: preserve-3d;
            transition: transform 0.1s;
        }

        .coin.flipping {
            animation: flip 2s ease-in-out;
        }

        @keyframes flip {
            0% {
                transform: rotateY(0deg) rotateX(0deg);
            }
            100% {
                transform: rotateY(1800deg) rotateX(360deg);
            }
        }

        .coin-face {
            position: absolute;
            width: 100%;
            height: 100%;
            backface-visibility: hidden;
            border-radius: 50%;
            overflow: hidden;
            box-shadow: 0 10px 30px rgba(0, 0, 0, 0.3);
        }

        .coin-face img {
            width: 100%;
            height: 100%;
            object-fit: cover;
        }

        .heads {
            transform: rotateY(0deg);
        }

        .tails {
            transform: rotateY(180deg);
        }

        .button {
            background: #11191F;
            color: white;
            border: none;
            padding: 15px 40px;
            font-size: 1.2em;
            border-radius: 50px;
            cursor: pointer;
            box-shadow: 0 4px 15px rgba(0, 0, 0, 0.1);
            transition: all 0.3s ease;
            font-weight: 500;
            font-family: 'FK Grotesk', -apple-system, BlinkMacSystemFont, 'Segoe UI', sans-serif;
            margin: 10px;
        }

        .button:hover:not(:disabled) {
            transform: translateY(-2px);
            box-shadow: 0 6px 20px rgba(0, 0, 0, 0.2);
        }

        .button:disabled {
            opacity: 0.5;
            cursor: not-allowed;
        }

        .result {
            margin-top: 30px;
            color: #11191F;
            font-size: 1.8em;
            font-weight: 500;
            min-height: 40px;
        }
    </style>
</head>

        <button class="button" id="flipButton" onclick="flipCoin()">FLIP COIN</button>
        
        <div class="result" id="result"></div>
    </div>

    <script>
        let isFlipping = false;

        function flipCoin() {
            if (isFlipping) return;
            
            isFlipping = true;
            const coin = document.getElementById('coin');
            const result = document.getElementById('result');
            const flipButton = document.getElementById('flipButton');
            
            flipButton.disabled = true;
            result.textContent = 'Flipping...';
            
            // Generate random result (true 50/50 probability)
            const isHeads = Math.random() < 0.5;
            
            // Remove previous classes
            coin.classList.remove('flipping');
            coin.style.transform = '';
            
            // Trigger reflow to restart animation
            void coin.offsetWidth;
            
            // Add flipping animation
            coin.classList.add('flipping');
            
            // After animation completes, show result
            setTimeout(() => {
                coin.classList.remove('flipping');
                
                // Set final position based on result
                if (isHeads) {
                    coin.style.transform = 'rotateY(0deg)';
                    result.textContent = 'Darian!';
                } else {
                    coin.style.transform = 'rotateY(180deg)';
                    result.textContent = 'ZBG!';
                }
                
                flipButton.disabled = false;
                isFlipping = false;
            }, 2000);
        }
    </script>
